import { useNavigate } from 'react-router-dom';


function about() {
    const navigate = useNavigate(); // Use useNavigate here



    
  useEffect(() => {
    const token = localStorage.getItem("authToken");
    if (!token) {
      window.location.href = "/";
    }
  }, [navigate]);


  return (
    <>
    <div>about</div>
    </>
  )
}

export default about
